import React,{Component} from "react";
import {Div0,Title,ChooseDiv} from'./style';
class SideBar extends Component{
    render(){
        return (
                <Div0>
                    <Title>
                        <img src='https://i.imgur.com/SOaMg6w.png'  height={64} width={100}></img>
                        
                    </Title>
                    <ChooseDiv></ChooseDiv>
                </Div0>
        )}}
export default SideBar;
